export default class AddNewItem_Transaction extends jsTPS_Transaction {
    constructor(initApp) {
        super()
        this.App = initApp;
    }
    doTransaction() {
        console.log("Crikey");
    }
    undoTransaction() {
        console.log("mikey");
    }
}
